import React from 'react';
import './letsTalk.scss';

function LetsTalk() {
    return (
        <div className="letsTalk">
                <span class="sentence-first">Interested?</span>
                <span class="sentence-second">Lets talk.</span>
        </div>
    );
}

export default LetsTalk;
